import React from "react";
import { Profile } from "../../apis/model";
import ContactItem from "./ContactItem";

interface Props {
  profileData: Profile;
  /*  setViewedPage: React.Dispatch<SetStateAction<string>> */
}

const Contact: React.FC<Props> = ({ profileData /* , setViewedPage */ }) => {
  const { contacts } = profileData;

  return (
    <>
      <div style={{ display: "flex", flex: 1 }} />
      <ul className="list" style={{ bottom: "-12px" }}>
        {contacts
          .sort((a, b) => a.priority - b.priority)
          .map((contact, index) => {
            return (
              <ContactItem
                {...{ contact }}
                /*  {...{ setViewedPage }} */ key={index}
              />
            );
          })}
      </ul>
    </>
  );
};
export default Contact;
